(() => {
    var t = JSON.parse(document.getElementById("script-configure-datadog-context").getAttribute("data-obj")),
        o = "fusion_info";
    window.DD_LOGS.onReady(() => {
        window.DD_LOGS.logger.setContextProperty(o, t)
    });
    window.DD_RUM.onReady(() => {
        window.DD_RUM.setGlobalContextProperty(o, t)
    });
})();